export default function Todo({ text, task }){

    function deleteHandler(){
        console.log(task)
    }

    return (
       <div className='task-body'>
            <li className='task-to-do'>
                {text}
            </li>
            <div className='check'>
                <i className='fas fa-check'></i>
            </div>
            <div className='trash' onClick={deleteHandler}>
                <i className='fas fa-trash'></i>
            </div>
       </div>
    )
}
